function Auth(){}Auth.prototype.run=function(){this.listenSiginEvent(),this.listenSigupEvent()},Auth.prototype.listenSiginEvent=function(n){var e=$(".card-signin"),a=e.find("input[name='telephone']"),o=e.find("input[name='username']"),u=e.find("input[name='password']"),s=e.find("input[name='remember']");e.find(".btn").click(function(){var n=a.val(),e=u.val(),t=o.val(),i=s.val();console.log(t),blogajax.post({url:"/account/login/",data:{telephone:n,username:t,password:e,remember:i},success:function(n){200===n.code&&blogalert.alertSuccess("登录成功",function(){window.location.href="/"})}})})},Auth.prototype.listenSigupEvent=function(n){var e=$(".card-signup"),o=e.find("input[name='username']"),u=e.find("input[name='password']"),s=e.find("input[name='email']"),l=e.find("input[name='repeat_password']"),r=e.find("input[name='telephone']");e.find(".btn").click(function(){var n=o.val(),e=r.val(),t=u.val(),i=l.val(),a=s.val();blogajax.post({url:"/account/signup/",data:{username:n,telephone:e,password:t,repeat_password:i,email:a},success:function(n){200===n.code&&blogalert.alertSuccess("注册成功",function(){window.location.href="/"})}})})},$(function(){(new Auth).run()});